import React, { Component } from "react";
class PhotoLibrary extends Component {
  state = {
    key: "fda8922284b87b4f38775239ea65f173",
    secret: "60f4b8039d57b683",
    photos: <React.Fragment></React.Fragment>
  };
  componentDidMount() {
    fetch(
      "https://www.flickr.com/services/rest/?method=flickr.galleries.getPhotos&api_key=fda8922284b87b4f38775239ea65f173&gallery_id=66911286-72157647277042064&format=json&nojsoncallback=1"
    )
      .then(data => data.json())
      .then(data => {
        const photos = data.photos.photo.map(obj => {
          const imageUrl =
            "https://farm" +
            obj.farm +
            ".staticflickr.com/" +
            obj.server +
            "/" +
            obj.id +
            "_" +
            obj.secret +
            ".jpg";
          obj.imageUrl = imageUrl;
          return obj;
        });

        let displayHtml = (
          <div
            id="carouselExampleIndicators"
            className="carousel slide"
            data-ride="carousel"
          >
            <ol className="carousel-indicators">
              <li
                data-target="#carouselExampleIndicators"
                data-slide-to="0"
                className="active"
              ></li>
              <li
                data-target="#carouselExampleIndicators"
                data-slide-to="1"
              ></li>
            </ol>
            <div className="carousel-inner">
              <div className="carousel-item active">
                <img
                  className="d-block w-100"
                  src="https://farm9.staticflickr.com/8187/8432423659_dd1b834ec5.jpg"
                  alt="First slide"
                />
              </div>
              <div className="carousel-item">
                <img
                  className="d-block w-100"
                  src="https://farm9.staticflickr.com/3896/14412870627_5a469dda2a.jpg"
                  alt="Second slide"
                />
              </div>
            </div>
            <a
              className="carousel-control-prev"
              href="#carouselExampleIndicators"
              role="button"
              data-slide="prev"
            >
              <span
                className="carousel-control-prev-icon"
                aria-hidden="true"
              ></span>
              <span className="sr-only">Previous</span>
            </a>
            <a
              className="carousel-control-next"
              href="#carouselExampleIndicators"
              role="button"
              data-slide="next"
            >
              <span
                className="carousel-control-next-icon"
                aria-hidden="true"
              ></span>
              <span className="sr-only">Next</span>
            </a>
          </div>
        );

        this.setState({ photos: displayHtml });
      });
  }
  render() {
    return this.state.photos;
  }
}

//https://farm9.staticflickr.com/8187/8432423659_dd1b834ec5.jpg
//https://farm{farm-id}.staticflickr.com/{server-id}/{id}_{secret}.jpg

export default PhotoLibrary;
